/*
 * COmpute the 26 Point DCt of float a[26] and store in float b[26]
 * Arguments    : float* a[26] Pointer to the MFCC before DCT
 * Return Type  : float* b[26] Pointer to location to store the DCT coefficients
 */
void dct(float* a,float* b){
	float y[NMEL]={0.0f};//volatile float y[NMEL]={0.0f};

	/*
	 *  % Re-order the elements of the columns of aa
	 *  % Same as
	 *  % y = [ aa(1:2:n,:); aa(n:-2:2,:) ];
	 */
	for (int i1 = 0, i2=0;i1<(int)floor(NMEL/2) ;i1++){
		y[i1]=a[i2];
		i2=i2+2;
	} // end y(1:floor(n/2)) = a(1:2:n)
	for (int i1 = (int)floor(NMEL/2),i2 = ((int)NMEL)-1;i1<((int)NMEL);i1++){
		y[i1]=a[i2];
		i2=i2-2;
	} // end y(floor(n/2)+1:n)= a[n:-2:2]
	/*
	 * % Compute weights to multiply DFT coefficients
	 * % Same as
	 * % ww = 2*exp(-1i*(0:n-1)'*pi/(2*n))/sqrt(2*n);
	 * % ww(1) = ww(1) / sqrt(2);
	 *
	 * Use Pre-computed values
	 * float W[26] = {0.19611613f,0.27684408f,0.27532789f,0.27280709f,0.26929080f,0.26479194f,0.25932685f,0.25291553f,0.24558131f,0.23735102f,0.22825466f,0.21832544f,0.20759952f,0.19611613f,0.18391714f,0.17104705f,0.15755279f,0.14348371f,0.12889102f,0.11382803f,0.098349698f,0.082512528f,0.066374242f,0.049993761f,0.033430863f,0.016745977f,0f,-0.016745983f,-0.033430863f,-0.049993753f,-0.066374227f,-0.082512505f,-0.098349705f,-0.11382803f,-0.12889102f,-0.14348368f,-0.15755281f,-0.17104703f,-0.18391714f,-0.19611613f,-0.20759952f,-0.21832544f,-0.22825466f,-0.23735102f,-0.24558131f,-0.25291553f,-0.25932685f,-0.26479194f,-0.26929080f,-0.27280709f,-0.27532789f,-0.27684408f};
	 */
	float W_real[NMEL]={0.0f};//volatile float W_real[NMEL]={0.0f};
	float W_imag[NMEL]={0.0f};//volatile float W_imag[NMEL]={0.0f};
	for (int ii = 0; ii<(int)NMEL; ii++){
		W_real[ii] = 2.0f/((float)sqrt(2*NMEL)) * ((float) cos(-((float)ii)*PI/(2*NMEL)));
		W_imag[ii] = 2.0f/((float)sqrt(2*NMEL)) * ((float) sin(-((float)ii)*PI/(2*NMEL)));
	} // for ii=0:n-1
	W_real[0]=W_real[0]/((float)sqrt(2));
	W_imag[0]=W_imag[0]/((float)sqrt(2));

	/*
	 * % Compute DCT using equation (5.92) in Jain
	 * % Same as
	 * % b = real(W .* fft(y));
	 *
	 * % Sanity Check for Complex Math Multiplication
	 * % W = (a+ib) ; y = (c+id);
	 * % x=@(a,b,c,d) (a.*c-b.*d)+1i*(a.*d+b.*c);
	 * % yt= fft(y);
	 * % err=norm(x(real(W),imag(W),real(yt),imag(yt))-W.*fft(y))
	 */
	float fBank_real[NMEL][NMEL];//volatile float fBank_real[NMEL][NMEL];
	float fBank_imag[NMEL][NMEL];//volatile float fBank_imag[NMEL][NMEL];
	for (int kk=0;kk<(int)NMEL;kk++){
		for (int ii= 0;ii<(int)NMEL;ii++){
			fBank_real[kk][ii] = ((float)cos((float)-2*PI*((float)kk)/NMEL*((float)ii)));
			fBank_imag[kk][ii] = ((float)sin((float)-2*PI*((float)kk)/NMEL*((float)ii)));
		}// for nCol = 0:n-1
	} // for nRow =0:n-1

	float yt_real[NMEL]={0.0f};//volatile float yt_real[NMEL]={0.0f};
	float yt_imag[NMEL]={0.0f};//volatile float yt_imag[NMEL]={0.0f};
	for (int kk=0;kk<(int)NMEL;kk++){
		for (int ii= 0;ii<(int)NMEL;ii++){
			yt_real[kk] = yt_real[kk] + y[ii]*fBank_real[kk][ii];
			yt_imag[kk] = yt_imag[kk] + y[ii]*fBank_imag[kk][ii];
		}// for nCol = 0:n-1
	} // for nRow =0:n-1

	// float* b[NMEL] is defined in extractFea.c
	for (int ii=0;ii<(int)NMEL;ii++)
		b[ii] = W_real[ii]*yt_real[ii] - W_imag[ii]*yt_imag[ii];
}// dct()


/*
 * Compute the angle of a complex number (a)
 * Arguments    : float y=real(a)
 *                float x=imag(a)
 * Return Type  : float atan(y/x)
 */
float approxAtan2(float y, float x)
{
	// Approximate atan2(y,x) of MATLAB
	//
	// Google "how arm atan2"
	// See https://www.dsprelated.com/showarticle/1052.php for more information
	//
	const float n1 = 0.97239411f;
	const float n2 = -0.19194795f;
	float result = 0.0f;
	float PI_2 = (float) PI*.5f;
	if(fabs(x)>0.0f) //if (x != 0.0f)
	{
		const union { float flVal; uint32_t nVal; } tYSign = { y };
		const union { float flVal; uint32_t nVal; } tXSign = { x };
		if (fabsf(x) >= fabsf(y))
		{
			union { float flVal; uint32_t nVal; } tOffset = { PI };
			// Add or subtract PI based on y's sign.
			tOffset.nVal |= tYSign.nVal & 0x80000000u;
			// No offset if x is positive, so multiply by 0 or based on x's sign.
			tOffset.nVal *= tXSign.nVal >> 31;
			result = tOffset.flVal;
			const float z = y / x;
			result += (n1 + n2 * z * z) * z;
		}
		else // Use atan(y/x) = pi/2 - atan(x/y) if |y/x| > 1.
		{
			union { float flVal; uint32_t nVal; } tOffset = { PI_2 };
			// Add or subtract PI/2 based on y's sign.
			tOffset.nVal |= tYSign.nVal & 0x80000000u;
			result = tOffset.flVal;
			const float z = x / y;
			result -= (n1 + n2 * z * z) * z;
		}
	}
	else if (y > 0.0f)
	{
		result = PI_2;
	}
	else if (y < 0.0f)
	{
		result = -PI_2;
	}
	return result;
} // end approxAtan2()


