#define MAX_MERGE_SORT_SIZE 9 // Adjust this size based on your needs

/**
 * Copies the contents of the source array to the destination array.
 *
 * @param dst Pointer to the destination array.
 * @param src Pointer to the source array.
 * @param len Number of elements to copy.
 */
void arrCpy(float* dst, const float* src, int len) {
    for (int ii = 0; ii < len; ii++) {
        dst[ii] = src[ii];
    }
}

/**
 * Merges two sorted subarrays into a single sorted array.
 *
 * @param y     Pointer to the output array where the merged result will be stored.
 * @param y1    Pointer to the first sorted subarray.
 * @param y1_len Length of the first sorted subarray.
 * @param y2    Pointer to the second sorted subarray.
 * @param y2_len Length of the second sorted subarray.
 * @param UD    Sorting order flag. Use 1 for ascending order, 0 for descending order.
 */
void merge(float* y, const float* y1, int y1_len, const float* y2, int y2_len, char UD) {
    int i = 0, j = 0, k = 0;
    while (i < y1_len && j < y2_len) {
        if ((UD == 1 && y1[i] <= y2[j]) || (UD == 0 && y1[i] >= y2[j])) {
            y[k++] = y1[i++];
        } else {
            y[k++] = y2[j++];
        }
    }
    while (i < y1_len) {
        y[k++] = y1[i++];
    }
    while (j < y2_len) {
        y[k++] = y2[j++];
    }
}

/**
 * Performs the merge sort algorithm on an array and optionally computes the ranking of elements.
 *
 * @param x_rank Pointer to the output array where the ranking of the original elements will be stored.
 * @param x      Pointer to the input array containing the magnitudes of the energy bands.
 * @param y      Pointer to the output array where the sorted magnitudes will be stored.
 * @param len    Number of elements in the array.
 * @param TOP    Flag to indicate if this is the top-level call (1 for top-level, 0 for recursive calls).
 * @param UD     Sorting order flag. Use 1 for ascending order, 0 for descending order.
 */
void mergeSort(int* x_rank, float* x, float* y, int len, char TOP, char UD) {
    static float mSort_tmp[MAX_MERGE_SORT_SIZE]; // Fixed-size mSort_tmporary array for merging

    if (len < 2) {
        arrCpy(y, x, len);
        if (len == 2 && ((UD == 1 && y[0] > y[1]) || (UD == 0 && y[0] < y[1]))) {
            mSort_tmp[0] = y[0];
            y[0] = y[1];
            y[1] = mSort_tmp[0];
        }
        return;
    }

    int y1_len = len / 2;
    int y2_len = len - y1_len;

    float y1[MAX_MERGE_SORT_SIZE], y2[MAX_MERGE_SORT_SIZE];
    arrCpy(y1, x, y1_len);
    arrCpy(y2, x + y1_len, y2_len);

    mergeSort(x_rank, y1, y1, y1_len, 0, UD);
    mergeSort(x_rank, y2, y2, y2_len, 0, UD);

    merge(mSort_tmp, y1, y1_len, y2, y2_len, UD);
    arrCpy(y, mSort_tmp, len);

    if (TOP == 1) {
        bRank(x_rank, x, y, len); // Compute the rankings
    }
}

/**
 * Computes the rank of each element in the original array based on the sorted array.
 *
 * @param y_rank Pointer to the output array where the rank of each element will be stored.
 * @param y      Pointer to the original array containing the magnitudes of the energy bands.
 * @param y_sort Pointer to the sorted array.
 * @param len    Number of elements in the arrays.
 */
void bRank(int* y_rank, const float* y, const float* y_sort, int len) {
    memset(y_rank, 0, (size_t)len * sizeof(int));
    for (int ii = 0; ii < len; ii++) {
        for (int iii = 0; iii < len; iii++) {
            if (fabs(y[ii] - y_sort[iii]) < 1e-12f) {
                y_rank[ii] = iii + 1; // MATLAB version runs from 1:9
                break;
            }
        }
    }
}
